import TaskEdit from './TaskEdit'

const Tasks = () => {
    const [edit, setEdit] = useState(false)

    return <div className='tasks'>
        {edit && <TaskEdit />}
        <button onClick={() => setEdit(true)} >+</button>
    </div>
}

export default Tasks
